import axios from 'axios';
import React, { useState, useEffect } from 'react';

function UserHistory() {
  const [data, setData] = useState([]);
  const [prediction, setPrediction] = useState('');

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get("http://localhost:3001/userHistory");
      console.log(response.data);
      setData(response.data);

      // Call a function to calculate and set prediction
      setPrediction(calculatePrediction(response.data));
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  const calculatePrediction = (data) => {
    // Perform prediction calculation based on data
    // For example:
    const prediction = 'Predicted Outcome: Positive';
    return prediction;
  };

  return (
    <div>
      <h1>{prediction}</h1>
      <div id="accordion">
        {data.map((item, index) => (
          <div className="accordion-item" key={index}>
            <h2 className="accordion-header" id={`heading${index}`}>
              <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target={`#collapse${index}`} aria-expanded="false" aria-controls={`collapse${index}`}>
                {`Data ${index + 1}`}
              </button>
            </h2>
            <div id={`collapse${index}`} className="accordion-collapse collapse" aria-labelledby={`heading${index}`} data-bs-parent="#accordion">
              <div className="accordion-body">
                <div>
                  <strong>Diabetes in Heredity:</strong> {item.Heredity === 1 ? 'Yes' : 'No'}
                </div>
                <div>
                  <strong>Duration of Physical Activity:</strong> {item.PhysicalActivity} minutes
                </div>
                <div>
                  <strong>Frequency of Fast Food:</strong> {item.FastFood}
                </div>
                <div>
                  <strong>Glucose level:</strong> {item.Glucose} mg/dL
                </div>
                <div>
                  <strong>Blood Pressure level:</strong> {item.BloodPressure} mmHg
                </div>
                <div>
                  <strong>BMI:</strong> {item.BMI} kg/m2
                </div>
                <div>
                  <strong>Age:</strong> {item.Age}
                </div>
                <div>
                  <strong>Outcome:</strong> {item.Outcome} %
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default UserHistory;
